import React, { useState } from 'react';
import Header from ''
import MainContent from './components/MainContent';  // Interface initiale
import survey from './components/survey';
function App() {
  const [currentPage, setCurrentPage] = useState('Home');

  const handleNavigation = (page) => {
    setCurrentPage(page);
  };

  return (
    <div>
      {currentPage === 'Home' && (
        <>
          <Header />
          <MainContent onNavigate={handleNavigation} />
          <Footer />
        </>
      )}

      {currentPage === 'Survey1' && (
        <SurveyPage1 onNavigate={handleNavigation} />
      )}

      {currentPage === 'Survey2' && (
        <SurveyPage2 onNavigate={handleNavigation} />
      )}
    </div>
  );
}

export default App;
